import React, { useEffect } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    useEffect(()=>{
      const resource = fetch('http://127.0.0.1:8000/api/customers');
      const json = resource.json();
      console.log("JSON is : "+json); 
    }
      ,[]);
  return (
    <div>
      <h3>Hii happy hacking</h3>
      </div>
  );
}

export default App;
